import React from 'react';
import './App.css';

import {useSelector} from 'react-redux'

function App() {
  const theme = useSelector(state => state.theme)

  return (
    <div className="App">
      <h1 className={theme}>Counter </h1>
    </div>
  );
}

export default App;
